import React from 'react';

import NavBar from './Components/NavBar';
import Main from './Components/Main';
import './App.css';
import { Container, Row } from 'react-bootstrap';

class App extends React.Component {
  render() {
    return (
      <Container className='root-container'>
        <Row>
          <NavBar />
        </Row>
        <Row>
          <Main />
        </Row>
      </Container>
    );
  }
}

export default App;
